import React  from 'react';
function Header() {
  return (
    <div>
      <header>
        <nav className="navBar">
          <a href="/#">ABOUT US</a>
          <a href="/#">FOR YOU</a>
          <a href="/#">SERVICES</a>
          <a href="/#">BLOG</a>
          <a href="/#">CONTACT</a>
        </nav>
      </header>
      <h1 className="tourHeader">Tourist PLACES</h1>
    </div>
  );
}

export default Header;
